import { initialState } from './initialState';

const selectedProgramReducer = (
  state = initialState.selectedProgram,
  action
) => {
  switch (action.type) {
    case 'SET_SELECTED_PROGRAM':
      return action.payload;

    default:
      return state;
  }
};

export { selectedProgramReducer };
